  private String value;

  ShipmentCarrier(String value) {
    this.value = value;
  }

  public String getValue() {
    return value;
  }

  @Override
  public String toString() {
    return String.valueOf(value);
  }

  public static ShipmentCarrier fromValue(String value) {
    for (ShipmentCarrier b : ShipmentCarrier.values()) {
      if (b.value.equals(value)) {
        return b;
      }
    }
    throw new IllegalArgumentException("Unexpected value '" + value + "'");
  }

  public static class Adapter extends TypeAdapter<ShipmentCarrier> {
    @Override
    public void write(final JsonWriter jsonWriter, final ShipmentCarrier enumeration) throws IOException {
      jsonWriter.value(enumeration.getValue());
    }

    @Override
    public ShipmentCarrier read(final JsonReader jsonReader) throws IOException {
      String value = jsonReader.nextString();
      return ShipmentCarrier.fromValue(value);
    }
  }
